import React from 'react';
import temple from '../img/temple.png'

const style = {
    color: '#ffffff',
    backgroundColor: '#000000',
    backgroundImage: `url(${temple})`,
    minWidth: '20%',
    maxWidth: 500,
    minHeight: '50%',
    maxHeight: '50%',
};

export default function Home() {
    return (
        <div style={style}>
            My First React Component!
        </div>
    );
}
